## Remarks <xref:System.Web.SessionState.SessionStateModule.Start> Zdarzenie jest zgłaszane na początku żądania po rozpoczęciu nowej sesji. Nowa sesja zostanie uruchomiona, jeśli zostanie wysłane żądanie, które nie zawiera identyfikatora sesji, identyfikator sesji jest nieprawidłowy lub sesja skojarzona z identyfikatorem sesji wygasła.
Zdarzenie **Session_OnStart** służy do wykonywania wszelkich czynności inicjacji dla sesji, takich jak Konfigurowanie wartości domyślnych zmiennych sesji.
Można określić procedurę obsługi dla <xref:System.Web.SessionState.SessionStateModule.Start> zdarzenia przez dodanie publicznej procedury podrzędnej o nazwie **Session_OnStart** do pliku Global. asax.
Aby uzyskać więcej informacji na temat pliku Global. asax, zobacz [składnia Global. asax](https://msdn.microsoft.com/library/9ade9d4d-4d52-4e88-af52-53a9ffa26582).
## Examples Poniższy przykład kodu przedstawia zawartość pliku Global. asax ze zdefiniowanymi zdarzeniami **Session_OnStart** i **Session_OnEnd** .
```vb <script language="VB" runat="server"> Public Sub Session_OnStart()
End Sub
Public Sub Session_OnEnd()
End Sub </script> ```
```csharp <script language="C#" runat="server"> public void Session_OnStart() {
}
public void Session_OnEnd() {
} </script> ```
